--
-- TOC entry 2089 (class 1255 OID 94766)
-- Name: cascade_refresh_scheduler(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.cascade_refresh_scheduler() RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    job RECORD;
BEGIN
    -- Check each job in our custom table
    FOR job IN 
        SELECT * FROM cascade_refresh_jobs 
        WHERE enabled = TRUE 
        AND next_run <= NOW() 
        AND is_running = FALSE
    LOOP
        -- We can't use transactions here, so just update the next run time
        UPDATE cascade_refresh_jobs 
        SET next_run = NOW() + job.schedule_interval,
            last_run = NOW()
        WHERE job_name = job.job_name;
        
        -- This won't work because we're already in a function transaction
        RAISE NOTICE 'Would run cascade job % but cannot execute procedures from functions', job.job_name;
    END LOOP;
END;
$$;


