-- TOC entry 2084 (class 1255 OID 70196)
-- Name: notify_candle_update(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.notify_candle_update() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
  symbol_name TEXT;
  timeframe_name TEXT;
BEGIN
  -- Extract symbol and timeframe from the continuous aggregate name
  -- Format: bitcoin_candles_15m or forex_candles_1h
  
  -- For Bitcoin aggregates
  IF TG_TABLE_NAME LIKE 'bitcoin_candles_%' THEN
    symbol_name := 'BTCUSD';
    timeframe_name := REPLACE(TG_TABLE_NAME, 'bitcoin_candles_', '');
  -- For Forex aggregates  
  ELSIF TG_TABLE_NAME LIKE 'forex_candles_%' THEN
    -- Would need to determine symbol from the data
    -- For now, skip forex
    RETURN NEW;
  ELSE
    RETURN NEW;
  END IF;
  
  -- Update the tracking table
  INSERT INTO candle_updates (symbol, timeframe, last_update, update_count)
  VALUES (symbol_name, timeframe_name, NOW(), 1)
  ON CONFLICT (symbol, timeframe) 
  DO UPDATE SET 
    last_update = NOW(),
    update_count = candle_updates.update_count + 1;
  
  -- Send notification
  PERFORM pg_notify(
    'candle_updates',
    json_build_object(
      'symbol', symbol_name,
      'timeframe', timeframe_name,
      'timestamp', NOW()
    )::text
  );
  
  RETURN NEW;
END;
$$;


