-- Name: _partial_view_29; Type: VIEW; Schema: _timescaledb_internal; Owner: -
--

CREATE VIEW _timescaledb_internal._partial_view_29 AS
 SELECT public.time_bucket('00:01:00'::interval, "time") AS "time",
    symbol,
    public.first(bid, "time") AS open,
    max(bid) AS high,
    min(bid) AS low,
    public.last(bid, "time") AS close,
    count(*) AS tick_count,
    avg(bid) AS vwap
   FROM public.forex_ticks
  GROUP BY (public.time_bucket('00:01:00'::interval, "time")), symbol;


